type F0<RT = void> = () => RT
type F1<A1, RT = void> = (arg: A1) => RT
type F2<A1, A2, RT = void> = (arg: A1, arg2: A2) => RT
type F3<A1, A2, A3, RT = void> = (arg: A1, arg2: A2, arg3: A3) => RT
type F4<A1, A2, A3, A4, RT = void> = (arg: A1, arg2: A2, arg3: A3, arg4: A4) => RT
type F5<A1, A2, A3, A4, A5, RT = void> = (arg: A1, arg2: A2, arg3: A3, arg4: A4, arg5: A5) => RT
